import About from "./About";
import Contacts from "./Contacts";
import HomePage from "./HomePage";
import Portfolio from "./Portfolio";

const AllPages = () => {
  return (
    <>
      <div className="px-auto">
        <HomePage />
        <About className="py-5" />
        <Portfolio />
        <Contacts />
      </div>
    </>
  );
};

export default AllPages;
